import logo from './logo.svg';
import styles from './App.module.scss';
import { Link, Route, withRouter} from "react-router-dom";
import Homepage from "./Homepage";
import Resume from "./Resume";
import Design from "./Design";
import Designs from "./Designs";
import Illustration from "./Illustration";
import Illustrations from "./Illustrations";
import { render } from '@testing-library/react';

function App() {
  render() ;
    const { location } = this.props;
    console.log(location.pathname);
    return (
      <div className={styles.App}>
        个人网站
        {/* Header */}
        <header className={styles.header}>
          <div className={styles.box}>
            <div className={styles.boxleft}>
              <div className={styles.square}></div>
              <Link to="/"><div>Jiayu Wen</div></Link>
            </div>
            <div className={styles.boxright}>
              <Link to="/"><p>about me</p></Link>
              <Link to="/resume"><p>resume</p></Link>
              <Link to="/designs"><p>design</p></Link>
              <Link to="/illustrations"><p>illustration</p></Link>
            </div>
          </div>
        </header>

        {/* Content */}
        <section className={styles.content}>
          <Route path="/" exact component={ Homepage }></Route>
          <Route path="/resume" exact component={ Resume }></Route>
          <Route path="/designs" exact component={ Designs }></Route>
          <Route path="/designs/:id" exact component={ Design }></Route>
          <Route path="/illustrations" exact component={ Illustrations }></Route>
          <Route path="/illustrations/:id" exact component={ Illustration }></Route>
        </section>

        {/* Footer */}
        <footer className={styles.footer}>
          <p><b>Location</b></p>
          <p>Stockholm, Sweden</p>
          <p><b>email</b></p>
          <p>jiayuwaern@gmail.com</p>
          <p>© 2021 by Jiayu Wen</p>
        </footer>
      </div>
    );
}

export default withRouter(App);
